export function toggleGameplay() {
  return {
    type: "toggleGamePlay",
    payload: null
  };
}
export function toggleBarReady() {
  return {
    type: "toggleBarReady",
    payload: null
  };
}
export function ChnageYVel(multi) {
  return {
    type: "ChangeYVel",
    payload: multi
  };
}
export function ChnageXVel(multi) {
  return {
    type: "ChangeXVel",
    payload: multi
  };
}
export function ChangeCoords(x, y) {
  return {
    type: "ChangeCoords",
    payload: {
      x,
      y
    }
  };
}
export function BrickHit(id) {
  return {
    type: "BrickHit",
    payload: id
  };
}
